import axios from 'axios'

const url = 'https://api.covid19india.org/state_district_wise.json'

export const fetchData = async () => {
    try {
        const { data } = await axios.get(url);
        const modifiedData = {
            Arunachal: data[29],
            Assam: data[28],
            Manipur: data[23],
            Meghalaya: data[33],
            Mizoram: data[24],
            Nagaland: data[32],
            Tripura: data[31]
        }
        return modifiedData;
    } catch (error) {

    }
}
